import { combineReducers } from 'redux';
import listTodo from '../reducer/listTodo.js';
import filterItems from '../reducer/filterItems.js';
import loadingTodo from '../reducer/loadingTodo.js';
import selectedItem from '../reducer/selectedItem.js';

const rootReducer = combineReducers({
    list: listTodo,
    filter: filterItems,
    loading: loadingTodo,
    selectedItem: selectedItem,
  });
  
  export default rootReducer;
